var $ = require("jquery");
require("./loading.scss");
var image_default =
  "data:image/gif;base64,";
/**
 *
 * @param {*} image 图片路径
 * @param {*} msg  对象，显示的提示文字
 */
function init(msg, styles, image) {
  if (!msg) {
    return false;
  }
  if (!image) {
    image = image_default;
  }
  console.log(styles);
  if(!styles){
  	styles = '';
  }
  var html =
    '<div class="popup_wrapper loading_popup">' +
    '<div class="loading"><img src="' +
    image +
    '" alt="loading" width="100%"></div>' +
    '<div class="msg" style="'+ styles+'"><p class="title">' +
    msg.title +
    '</p><p class="txt">' +
    msg.txt +
    "</p></div> " +
    "</div>";

  $("body").prepend(html);
}

function show() {
  $(".loading_popup").show();
}
function hide() {
  $(".loading_popup").hide();
}

module.exports = {
  init: init,
  show: show,
  hide: hide
};
